ビルウォールレザー/BWL/Bill Wall Leather/18k Small BWL Spacer/Bill Wall Custom Handcrafted Rings細身で大変スタイリッシュなスペーサーリングの登場です！！<br>BWLの刻印とクロスデザインが大変シンプルに描かれており、ワンポイントとして決めたい場合には最適のリングです。<br>リング素材は、18Kゴールドとなっており、厚みもあり高級感抜群です。<br>18Kはローズゴールド、ホワイトゴールド、イエローゴールドの3種類からお選び頂けます。<br> 指輪としてではなく、レザーコードに付けてネックレスとしてもお使い頂ける、オシャレなリングです。<br><br>●素材：シルバー925、各種18K素材</DIV>
